import React from "react";
import "./Registration.css";

const Registration = () => {
    return (
        <div className="background">
            {/* Registratie Container */}
            <div className="container registration">
                <h1 className="title gradient-text">Create Your Account</h1>
                <p className="subtitle">Join us today and start exploring!</p>
                <form className="form">
                    <input type="text" className="input" placeholder="Full Name" required />
                    <input type="email" className="input" placeholder="Email Address" required />
                    <input type="password" className="input" placeholder="Password" required />
                    <input type="password" className="input" placeholder="Confirm Password" required />
                    <label className="terms box">
                        <input type="checkbox" required /> I agree to the{" "}
                        <a href="#" className="link">
                            Terms and Conditions
                        </a>
                    </label>
                    <button type="submit" className="button hover-scale">
                        Sign Up
                    </button>
                </form>
                <p className="footer-text">
                    Already have an account?{" "}
                    <a href="#" className="link">
                        Login Now
                    </a>
                </p>
            </div>
        </div>
    );
};

export default Registration;
